import React from "react";
import "./components/Nav.css"

export default class Nav extends React.Component {

  render() {
    return (
      <div class="league-bar">
            <button class="main-button">Premier League</button>
            <button class="main-button">La Liga</button>
            <button class="main-button">Ekstraklasa</button>
            <button class="main-button">LM</button>
      </div>
    );
  }
}
